function createBackup(a=null){var e=$("#page-axios-data").data("create-delete-backup-url"),o=$("#create-backup-modal");o.modal("show"),axios.post(e,{option:a}).then(a=>{location.reload()}).catch(a=>{location.reload()})}function deleteBackup(){var a=$("#page-axios-data").data("delete-backup-url"),e=$("#delete-backup-modal");e.modal("show"),axios.delete(a).then(a=>{location.reload()}).catch(a=>{location.reload()})}$("#backup-table").DataTable({order:[[3,"desc"]]});